firefox_desktop_staging AS (
  SELECT received_date,
  version_major,
  geo_country,
  platform,
  --denominators
  use_counter_content_documents_destroyed, 
  use_counter_top_level_content_documents_destroyed,
  use_counter_service_workers_destroyed,
  use_counter_shared_workers_destroyed, 
  use_counter_dedicated_workers_destroyed, 
  metric,
  cnt,
  CASE WHEN metric LIKE 'use_counter_css_doc_%' THEN SAFE_DIVIDE(cnt, use_counter_content_documents_destroyed) ELSE NULL END AS doc_rate,
  CASE WHEN metric LIKE 'use_counter_css_page_%' THEN SAFE_DIVIDE(cnt, use_counter_top_level_content_documents_destroyed) ELSE NULL END AS page_rate, 
  CASE WHEN metric LIKE 'use_counter_worker_service_%' THEN SAFE_DIVIDE(cnt, use_counter_service_workers_destroyed) ELSE NULL END AS service_rate,
  CASE WHEN metric LIKE 'use_counter_worker_shared_%' THEN SAFE_DIVIDE(cnt, use_counter_shared_workers_destroyed) ELSE NULL END AS shared_rate,
  CASE WHEN metric LIKE 'use_counter_worker_dedicated_%' THEN SAFE_DIVIDE(cnt, use_counter_dedicated_workers_destroyed) ELSE NULL END AS dedicated_rate
  FROM firefox_desktop_pivoted_raw
) ,

